import React, { Component } from 'react';
class Home extends Component {
  render() {
    return (
        <div>
        <img src="https://img.icons8.com/android/24/000000/left.png"></img>
        <img src="https://img.icons8.com/material-outlined/48/000000/home--v2.png"></img>
        </div>
    );
  }
}

export default Home;
